    "promoterInfo": "Introduced in 2006, this award-winning program is designed to help you bridge the gap from club rider to team racer. In a six-week series of workshops, clinics, and rides, we'll teach you everything you need to know to begin road racing and then support you at your first race. This program is limited to eight riders each session. A solid level of cycling fitness is required. Program fee includes custom team jersey, USA Cycling License, race registration fee, twice-weekly team training, and a group training program. Contact Coaching{at}velogirls.com to schedule an assessment.",
