    "promoterInfo": "In this 4-hour co-ed clinic, you'll learn how to climb like a pro – seated climbs, standing climbs, short climbs, steep climbs, extended climbs.  And then, you'll learn how to come back down again, focusing on a fast straight descent, and then a technical switchbacky descent.  Pre-requisite: Bike Skills 101 or equivalent experience.",
